import React from 'react';
import './Clients.css';

function HeroSection({
  lightBg,
  topLine,
  lightText,
  lightTextDesc,
  shiftRight,
  headline,
  description,
  buttonLabel,
  img,
  alt,
  imgStart,
}) {
  return (
    <>
      <div className='clients__hero-section'>
        <div className='container'></div>
      </div>
    </>
  );
}

export default HeroSection;
